import React from 'react';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import { Grid } from '@material-ui/core';
import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';
import PlaceTwoToneIcon from '@material-ui/icons/PlaceTwoTone';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import Rating from '@material-ui/lab/Rating';
import StarBorderIcon from '@material-ui/icons/StarBorder';
import AccountCircleTwoToneIcon from '@material-ui/icons/AccountCircleTwoTone';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import ProfileInfo from './profileInfo';
import CardContent from '@material-ui/core/CardContent';




import { red } from '@material-ui/core/colors';

import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

import ListSubheader from '@material-ui/core/ListSubheader';
const useStyles = makeStyles(theme => ({
  bigAvatar: {
    width: 150,
    height: 150,
  },
  container: {
    backgroundColor:'#CCCFDD',
  },
  root1: {
    flexGrow: 1,
    maxWidth: 500,
  },
  card: {
    maxWidth: 345,
  },
  avatar: {
    backgroundColor: red[500],
    width: 150,
 height: 150,
  },
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 500,
    height: 450,
  },
  icon: {
    color: 'rgba(255, 255, 255, 0.54)',
  },
}));
export default function SimpleContainer() {
    const [value, setValue] = React.useState(0);
    const [valu, setValu] = React.useState(5);
    const [hover, setHover] = React.useState(-1);
    const handleChange = (event, newValue) => {
        setValue(newValue);
    };
    const labels = {
        0.5: 'Useless',
        1: 'Useless+',
        1.5: 'Poor',
        2: 'Poor+',
        2.5: 'Ok',
        3: 'Ok+',
        3.5: 'Good',
        4: 'Good+',
        4.5: 'Excellent',
        5: 'Excellent+',
      };
    const classes = useStyles();
    return (
    <React.Fragment>
        <CssBaseline />
            <Grid container  justify="center" spacing={2}>
                <Grid item xs={5}>
                <Card className={classes.card}>
                  <CardHeader
                    avatar={
                      <Avatar aria-label="recipe" src="https://c4.wallpaperflare.com/wallpaper/200/466/543/monica-bellucci-actress-women-wallpaper-preview.jpg" className={classes.avatar}>
                      </Avatar>
                    }
                    title="Monica Bellucci "
                    subheader={<Box component="fieldset" mb={3} borderColor="transparent">
                    <Typography component="legend">55 ans</Typography>
                    <div className={classes.rating1}>
                    <Box ml={2}>{labels[hover !== -1 ? hover : valu]}</Box>
                      <Rating
                        name="hover-side"
                        value={value}
                        precision={0.5}
                        onChangeActive={(event, newHover) => {
                          setHover(newHover);
                        }}
                      />

                    </div>
                  </Box>}
                  />

                  <CardContent>
                    <Typography variant="body2" color="textSecondary" component="p">
                      This impressive paella is a perfect party dish and a fun meal to cook together with your
                      guests. Add 1 cup of frozen peas along with the mussels, if you like.
                    </Typography>
                    <div className={classes.root}>
                      <GridList cellHeight={180} className={classes.gridList}>
                        <GridListTile key="Subheader" cols={2} style={{ height: 'auto' }}>
                          <ListSubheader component="div">December</ListSubheader>
                        </GridListTile>
                        {/* {tileData.map(tile => (
                          <GridListTile key={tile.img}>
                            <img src={tile.img} alt={tile.title} />
                            <GridListTileBar
                              title={tile.title}
                              subtitle={<span>by: {tile.author}</span>}
                              actionIcon={
                                <IconButton aria-label={`info about ${tile.title}`} className={classes.icon}>
                                  <InfoIcon />
                                </IconButton>
                              }
                            />
                          </GridListTile>
                        ))} */}
                      </GridList>
                    </div>
                  </CardContent> 
                </Card>

                </Grid>
                <Grid item xs={6}>
                    <Paper square className={classes.root1}>
                        <Tabs value={value} onChange={handleChange} variant="fullWidth" indicatorColor="primary" textColor="secondary">
                          <Tab icon={<AccountCircleTwoToneIcon />} label="INFOS" id ='0'/>
                          <Tab icon={<PlaceTwoToneIcon />} label="LOCALISATION" id='1'/>
                        </Tabs>
                    </Paper>
                </Grid>
            </Grid>
   </React.Fragment>
  );
}
